import React,{useState} from 'react';
import { FormControl, FormGroup, InputLabel, Input, Typography, Button } from '@mui/material';
import styled from '@emotion/styled';
import axios from 'axios';
import { Link, NavLink } from 'react-router-dom';

const Container = styled(FormGroup)`
    width:50%;
    margin: 5% 30%;
    & > div {
        margin-top:20px;
    }
`

const Home = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [userType, setUserType] = useState("");

  const submitData = () => {
    if(userType === 'admin'){
      console.log(userType === 'admin');

      <NavLink to='/adminNavbar'/>
    }
  }

    return(

      <Container>
      <Typography variant='h4'>Login</Typography>
      <FormControl>
          <InputLabel>Username</InputLabel>
          <Input name="username" onChange={(e)=> {setUsername(e.target.value)}}/>
      </FormControl>
      <FormControl>
          <InputLabel>Password</InputLabel>
          <Input name="password" onChange={(e)=> {setPassword(e.target.value)}}/>
      </FormControl>
      <FormControl>
          <InputLabel>User Type</InputLabel>
          <Input name="userType" onChange={(e)=> {setUserType(e.target.value)}}/>
      </FormControl>
      <FormControl>
            <NavLink variant="contained" to={submitData}>Login</NavLink>
      </FormControl>
      </Container>

      )
}

export default Home;
